const writeFile = (headerString, fileString) => {
    const dateStampedFileName = `./formatted-pose-data/pose-data-${moment().format().replace(/:/g,'_')}.csv`
    fs.appendFile(dateStampedFileName, headerString, function (err) {
        if (err) throw err;
        console.log('Saved headers!');
    });
    fs.appendFile(dateStampedFileName, fileString, function (err) {
        if (err) throw err;
        console.log('Saved contents!');
    });
}

const writeAggregateSkeletonToCsv = (jointsToAnalyze, aggregateSkeleton, jointLabels, getNewLine, writeFile) => {
    const coord_headers = ['px','py', 'py_avg','pz'] // ['px','py','pz', 'rw', 'rx', 'ry', 'rz']
    let fileString = ''
    let x = 0
    
    jointsToAnalyze.forEach(jointNumber => console.log(jointLabels[jointNumber]))
    const numberDataRows = aggregateSkeleton[jointLabels[jointsToAnalyze[0]]].length

    while (x < numberDataRows) {
        jointsToAnalyze.forEach(joint => {
            const arrayOfJointObjects = aggregateSkeleton[jointLabels[joint]]
            
            const rowObj = arrayOfJointObjects[x]
            const row = coord_headers.map(header => rowObj[header]).join(',')
            fileString = fileString + row + ','

        })
        fileString = fileString + getNewLine()
        x = x+1
    }

    const headers = jointsToAnalyze.map(jointName => coord_headers.map(header => `${jointLabels[jointName]}_${header}`).join(','))
    const headerString = headers.join(',').concat(getNewLine())

    writeFile(headerString, fileString)
}
